        Random random = new Random();

        int somar1, somar2, sub1, sub2, mult1, mult2;

        public void StartQ()
        {
            somar1 = random.Next(1, 30);
            somar2 = random.Next(1, 30);
            LblSoma1.Text = somar1.ToString();
            LblSoma2.Text = somar2.ToString();
            ResSoma.Value = 0;


            sub1 = random.Next(1, 30);
            sub2 = random.Next(1, 30);
            LblSub1.Text = sub1.ToString();
            LblSub2.Text = sub2.ToString();
            ResSub.Value = 0;


            mult1 = random.Next(1, 6);
            mult2 = random.Next(1, 6);
            LblMult1.Text = mult1.ToString();
            LblMult2.Text = mult2.ToString();
            ResMult.Value = 0;

            

        }

        private bool ChecarRespostas()
        {
            if ((somar1 + somar2 == ResSoma.Value) && (sub1 - sub2 == ResSub.Value) && (mult1 * mult2 == ResMult.Value))
            {
                return true;
            }
            else
            {
                return false;
            }

            

        }

       
